Accounts_CustomFields_Description:
Moet 'n geldige JSON wees waar sleutels die veldname bevat wat 'n woordeboek van veldinstellings bevat. Voorbeeld:<br/><code>{
"rol": {
"tipe": "kies",
"defaultValue": "student",
"opsies": ["onderwyser", "student"],
"vereiste": waar,
"modifyRecordField": {
"skikking": waar,
"veld": "rolle"
}
},
"twitter": {
"tipe": "teks",
"vereiste": waar,
"minlengte": 2,
"maksimum lengte": 10
}
}</code>

Custom_Translations_Description:
Moet 'n geldige JSON wees waar sleutels tale bevat wat 'n woordeboek van sleutel en vertalings bevat. Voorbeeld:<br/><code>{
"en": {
"Kanale": "Kamers"
},
"pt": {
"Kanale": "Salas"
}
}</code>
